style:
  .grid-layout {
    flex: 1;
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-template-rows: auto;
    gap: 16px;
    margin: 30px;
    max-width: 500px;

    .input-item {
      height: 32px;
      background: #00ccff;
      border-radius: 4px;
    }

    ._g2 {
      grid-column: span 2; /* 对应第一个元素 */
    }
  }

.tmpl-steps {
  display: flex;
  align-items: center;
  gap: 9px;

  .tmpl-step-item {
    width: 40px;
    height: 40px;
    background-color: #999999;
    color: white;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size: 18px;
    font-weight: bold;
    &.active {
    background-color: #00ccff;
    }
  }

  .tmpl-step-line {
    width: 103px;
    height: 1px;
    border-top: 2px solid #979797;
    &.active {
      border-color: #00ccff;
    }
  }
}

.grid-list {
  // https://grid.layoutit.com/
  width: 300px;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: auto;
  gap: 10px;
  grid-template-areas:
    "a a"
    "b c";

  .list-item {
    height: 50px;
    background-color: #00ccff;

    &._a {
      grid-area: a;
    }

    &._b {
      grid-area: b;
    }

    &._c {
      grid-area: c;
    }
  }
}

.main-frame {
  height: 100%;
  display: flex;
  align-items: center;

  .nav-left {
    height: 100%;
    width: 200px;
    background: #cccccc;
  }

  .main-right {
    flex: 1;
    height: 100%;
    display: flex;
    flex-direction: column;
    background-color: #D8D8D8;

    .nav-top {
      padding: 14px 30px;
      background: #979797;
      display: flex;
      align-items: center;
      justify-content: space-between;

      .image-item {
        display: flex;
        align-items: center;

        .image-wrapper {
          width: 20px;
          height: 20px;
          background: #D8D8D8;
          border: 1px solid #979797;
          margin-right: 8px;
          border-radius: 50%;
        }

        .item-text {
          font-size: 14px;
        }
      }
    }

    .content-wrap {
      flex: 1;
      overflow: auto;
      padding: 30px;
      
    }
  }
}

.image-text-list {
  .list-item {
    display: flex;
    align-items: center;

    &+.list-item {
      margin-top: 16px;
    }

    .item-image {
      display: block;
      width: 32px;
      height: 32px;
      border-radius: 8px;
      margin-right: 16px;
    }

    .item-text {}
  }
}

.ytb-item {
  cursor: pointer;

  .ytb-cover {
    width: 352px;
    height: 198px;
    border-radius: 16px;
    position: relative;
    overflow: hidden;

    .cover-img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

    .play-cover {
      position: absolute;
      z-index: 1;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      opacity: 0;
      background-color: rgba(0, 0, 0, 0.1);
      visibility: hidden;
      transition: all .3s;
      display: flex;
      align-items: center;
      justify-content: center;

      .play-cover-icon {
        width: 50px;
        height: 50px;
      }
    }
  }

  &:hover {
    .ytb-cover {
      .play-cover {
        opacity: 1;
        visibility: visible;
      }
    }
  }

  .title-wrap {
    display: flex;
    align-items: center;
    margin-top: 8px;

    .tab-icon {
      width: 40px;
      height: 40px;
      display: inline-block;
      margin-right: 8px;
      border-radius: 50%;
    }

    .tab-text {
      font-size: 16px;
      font-weight: 500;
    }
  }
}

.step-card {
  width: 347px;
  background: white;
  border-radius: 16px;
  padding: 24px;
  font-size: 18px;
  font-weight: 500;
  color: black;

  .step-title {
    font-size: 48px;
    margin-bottom: 16px;
    font-weight: bold;
    line-height: 1;
  }

  .step-desc {
    line-height: 1.7;
  }
}

.tab-list {
  display: flex;
  justify-content: center;
  gap: 80px;

  .tab-item {
    display: flex;
    align-items: center;
    border-bottom: 2px solid transparent;
    border-radius: 1px;
    padding: 2px;
    cursor: pointer;
    gap: 8px;

    &.active {
      border-color: #00ccff;
    }

    .tab-icon {
      width: 32px;
      height: 32px;
      display: inline-block;
      margin-right: 8px;
    }

    .tab-text {
      font-size: 20px;
      font-weight: 600;
    }
  }
}

  .lr-layout {
    display: flex;
    align-items: center;
    justify-content: space-between;

    .lr-left {
      flex: 1;
    }

    .lr-title {
      font-size: 20px;
      font-weight: bold;
      margin-bottom: 8px;
    }

    .lr-desc {
      font-size: 16px;
      font-weight: 400;
    }

