        margin-right: 32px;
      }
    }
  }

.image-item {
  text-align: center;

  .image-wrapper {
    width: 56px;
    height: 56px;
    display: inline-block;

    .item-img {
      width: 100%;
      height: 100%;
    }
  }

  .item-text {
    margin-top: 8px;
  }
}

